app.post('/game', async (request, response) => {

  //  const { id } = request.body;
  console.log(request.body);
  const hardcodedData = {
    image_base64: " data:image/svg+xml;base64,",
    genre: request.body.genre,
    rate: request.body.rate,
    description: request.body.description,
    title: request.body.title,
    id: request.body.gameId
  };


  const { image_base64, genre, rate, description, title, id } = hardcodedData;

  try {
    const game = await sql`
      INSERT INTO game (image_base64, genre, rate, description, title, id)
      VALUES (${image_base64}, ${genre}, ${rate}, ${description}, ${title}, ${id})
      RETURNING image_base64, genre, rate, description, title, id
    `;

    response.send(game);
  } catch (error) {
    console.error('Error inserting data:', error);
    response.status(500).send('Internal Server Error');
  }
});


